'use strict';
let PriceHistoryList = require('./PriceHistoryList.js');
let MessageType = require('./MessageType.js');
class GetPriceHistoryMessage {
    priceHistoryList;
    symbol;
    stream;
    timeframe;
    requestId;
    error;
    constructor() {
        this.priceHistoryList = new PriceHistoryList();
        this.symbol = null;
        this.stream = null;
        this.timeframe = null;
        this.requestId = null;
        this.error = null;
    }
    getPrices() {
        return this.priceHistoryList.toArray();
    }
    getType() {
        return MessageType.PriceHistory;
    }
    getSymbol() {
        return this.symbol;
    }
    getStream() {
        return this.stream;
    }
    getTimeframe() {
        return this.timeframe;
    }
    getRequestId() {
        return this.requestId;
    }
    getError() {
        return this.error;
    }
}
module.exports = GetPriceHistoryMessage
